import "./AdminLoginPage.css";

const AdminLoginPage = () => {
  return (
    <div className="AdminLoginPageWrapper">
        <form action="" className="AdminLoginForm">
          <label htmlFor="AdminLoginUserNameInput" className="AdminLoginUserNameInputLabel">Username</label>
          <input
            type="text"
            className="AdminLoginUserNameInput"
            id="AdminLoginUserNameInput"
            placeholder="admin username"
          />
          <label htmlFor="AdminLoginPasswordInput" className="AdminLoginPasswordInputLabel">Password</label>
          <input
            type="password"
            className="AdminLoginPasswordInput"
            id="AdminLoginPasswordInput"
            placeholder="admin password"
          />
          <button className="AdminLoginButton">Login</button>
        </form>
        <p className="AdminLoginForgotPasswordLink">Forgot Password?</p>
    </div>
  );
};

export default AdminLoginPage;
